import React, {Fragment} from "react";
import {Card, Button} from "@shopify/polaris";
import opt from "./opt";



 class Index extends React.Component {
  render() {
    return (
      <>
      <Card sectioned title="Dashboard" actions={[{content: 'Add variant'}]}>
          <p>
            Home
          </p>
      </Card>

<Card>
      <p>Ceate an attribute</p>
      <button primary>Start Task </button>

</Card>

<Card>
<Card.Section title="Application Stats">

<Card.Section title="Total Customers">
  <p>0</p>
  
</Card.Section>

<Card.Section title="Total Orders">
  <p>0</p>
</Card.Section>

<Card.Section title="Total Attributes">
  <p>0</p>
</Card.Section>

</Card.Section>
</Card>

</>

    );  
  }
}


export default Index;
